import {
  Button,
  FormControl,
  InputLabel,
  MenuItem,
  Select,
  styled,
  TextField,
} from "@mui/material";

import { useCallback, useState } from "react";
import { Controller, useForm } from "react-hook-form";
import { getFieldState } from "../utils/getFieldState";
import validator from "validator";
import { validateIIN } from "../utils/validateNumbers";
import { IMask } from "react-imask";
export const FormPage = () => {
  // const label = { inputProps: { "aria-label": "Checkbox demo" } };

  const { handleSubmit, control, reset } = useForm({
    mode: "onChange",
    defaultValues: {
      iin: "",
      fullNameOfOrganization: "",
      secondName: "",
      firstName: "",
      fathersName: "",
      email: "",
      phone: "",
      position: "",
      region: null,
      area: "",
      adress: "",
    },
  });
  const Form = styled("form")`
    tr {
      width: 600px;
      vertical-align: right;
      margin-right: 10px;
    }
    td {
      align-items: center;
    }
  `;

  // const validateForm = (e: any) => {
  //   e.preventDefault();

  //   if (iin.length < 12) {
  //     alert("Enter right IIN");
  //     return;
  //   }

  //   const data = {
  //     iin,
  //   };
  // };
  const onSubmit = useCallback(
    (values: any) => {
      alert("SUBMIT");
      console.log(values);

      reset();
    },
    [reset],
  );
  return (
    <Form onSubmit={handleSubmit(onSubmit)} style={{ marginLeft: "60px" }}>
      <h3>Данные об организации</h3>

      <FormControl fullWidth sx={{ mb: 2 }}>
        <Controller
          name="iin"
          control={control}
          rules={{
            required: "Поле обязательное",
            validate: (value) => {
              if (validateIIN(value)) {
                return true;
              } else {
                return "Not Valid";
              }
            },
          }}
          render={({ field, fieldState, formState }) => (
            <tr>
              <td> БИН /ИИН:</td>
              <td>
                <TextField
                  type="number"
                  id="outlined-basic"
                  label="IIN"
                  {...getFieldState({ fieldState, formState })}
                  variant="outlined"
                  {...field}
                />
              </td>
            </tr>
          )}
        />
      </FormControl>

      <FormControl fullWidth sx={{ mb: 2 }}>
        <Controller
          name="fullNameOfOrganization"
          control={control}
          rules={{
            required: "Поле обязательное",
            validate: (value) => {
              if (value.length < 200) {
                return true;
              } else {
                return "Not Valid";
              }
            },
          }}
          render={({ field, fieldState, formState }) => (
            <tr>
              <td> Полное наименование:</td>
              <td>
                <TextField
                  id="outlined-basic"
                  label="Name"
                  {...getFieldState({ fieldState, formState })}
                  variant="outlined"
                  {...field}
                />
              </td>
            </tr>
          )}
        />
      </FormControl>
      <h3>Данные представителя</h3>
      <FormControl fullWidth sx={{ mb: 2 }}>
        <Controller
          name="secondName"
          control={control}
          rules={{
            required: "Поле обязательное",
            validate: (value) => {
              if (value.length > 3) {
                return true;
              } else {
                return "Not Valid";
              }
            },
          }}
          render={({ field, fieldState, formState }) => (
            <tr>
              <td> Фамилия:</td>
              <td>
                <TextField
                  id="outlined-basic"
                  label="Фамилия"
                  {...getFieldState({ fieldState, formState })}
                  variant="outlined"
                  {...field}
                />
              </td>
            </tr>
          )}
        />
      </FormControl>
      <FormControl fullWidth sx={{ mb: 2 }}>
        <Controller
          name="firstName"
          control={control}
          rules={{
            required: "Поле обязательное",
            validate: (value) => {
              if (value.length > 3) {
                return true;
              } else {
                return "Not Valid";
              }
            },
          }}
          render={({ field, fieldState, formState }) => (
            <tr>
              <td> Имя:</td>
              <td>
                <TextField
                  id="outlined-basic"
                  label="Имя"
                  {...getFieldState({ fieldState, formState })}
                  variant="outlined"
                  {...field}
                />
              </td>
            </tr>
          )}
        />
      </FormControl>
      <FormControl fullWidth sx={{ mb: 2 }}>
        <Controller
          name="fathersName"
          control={control}
          rules={{
            validate: (value) => {
              if (value.length > 3) {
                return true;
              } else {
                return "Not Valid";
              }
            },
          }}
          render={({ field, fieldState, formState }) => (
            <tr>
              <td>
                Отчество <span style={{ color: "lightgrey" }}>(необязательный)</span>:
              </td>
              <td>
                <TextField
                  id="outlined-basic"
                  label=" Отчество"
                  {...getFieldState({ fieldState, formState })}
                  variant="outlined"
                  {...field}
                />
              </td>
            </tr>
          )}
        />
      </FormControl>
      <FormControl fullWidth sx={{ mb: 2 }}>
        <Controller
          name="email"
          control={control}
          rules={{
            required: "Поле обязательное",
            validate: (value) => {
              if (validator.isEmail(value)) {
                return true;
              } else if (value.length == 0) {
                return true;
              } else {
                return "invalid email";
              }
            },
          }}
          render={({ field, formState, fieldState }) => (
            <tr>
              <td>Эл. почта:</td>
              <td>
                <TextField
                  id="outlined-basic"
                  label="Эл. почта"
                  variant="outlined"
                  {...getFieldState({ fieldState, formState })}
                  {...field}
                />
              </td>
            </tr>
          )}
        />
      </FormControl>
      <FormControl fullWidth sx={{ mb: 2 }} required>
        <Controller
          name="phone"
          control={control}
          rules={{
            required: "Поле обязательное",
            // validate: (value) => {
            //   return IMask(value, maskOptions);
            // },
          }}
          render={({ field, formState, fieldState }) => (
            <tr>
              <td>Номер:</td>
              <td>
                <TextField
                  id="outlined-basic"
                  label="phone"
                  variant="outlined"
                  placeholder="+7(000)000-00-00"
                  {...getFieldState({ fieldState, formState })}
                  {...field}
                />
              </td>
            </tr>
          )}
        />
      </FormControl>
      <FormControl fullWidth sx={{ mb: 2 }}>
        <Controller
          name="position"
          control={control}
          rules={{
            required: "Поле обязательное",
            validate: (value) => {
              if (value.length > 3) {
                return true;
              } else {
                return "Not Valid";
              }
            },
          }}
          render={({ field, fieldState, formState }) => (
            <tr>
              <td> Должность:</td>
              <td>
                <TextField
                  id="outlined-basic"
                  placeholder="Введите"
                  {...getFieldState({ fieldState, formState })}
                  variant="outlined"
                  {...field}
                />
              </td>
            </tr>
          )}
        />
      </FormControl>
      <FormControl fullWidth sx={{ mb: 2 }}>
        <Controller
          name="position"
          control={control}
          rules={{
            required: "Поле обязательное",
            validate: (value) => {
              if (value.length > 3) {
                return true;
              } else {
                return "Not Valid";
              }
            },
          }}
          render={({ field, fieldState, formState }) => (
            <tr>
              <td>
                Основание полномочий <span style={{ color: "lightgrey" }}>(необязательный)</span>:
              </td>
              <td>
                <TextField
                  id="outlined-basic"
                  label=""
                  placeholder="Введите"
                  {...getFieldState({ fieldState, formState })}
                  variant="outlined"
                  {...field}
                />
              </td>
            </tr>
          )}
        />
      </FormControl>
      <h3>Adress</h3>
      <FormControl fullWidth sx={{ mb: 2 }}>
        <InputLabel id="demo-simple-select-label">Город</InputLabel>
        <Controller
          name="region"
          control={control}
          render={({ field }) => (
            <tr>
              <td>Регион :</td>
              <td>
                <Select
                  labelId="demo-simple-select-label"
                  id="demo-simple-select"
                  label="Город"
                  {...field}>
                  <MenuItem value={10}>Алматинская область</MenuItem>
                  <MenuItem value={20}>Акмолинская область</MenuItem>
                  <MenuItem value={30}>Алматы</MenuItem>
                </Select>
              </td>
            </tr>
          )}
        />
      </FormControl>
      <FormControl fullWidth sx={{ mb: 2 }}>
        <Controller
          name="position"
          control={control}
          rules={{
            required: "Поле обязательное",
            validate: (value) => {
              if (value.length > 3) {
                return true;
              } else {
                return "Not Valid";
              }
            },
          }}
          render={({ field, fieldState, formState }) => (
            <tr>
              <td>
                Основание полномочий <span style={{ color: "lightgrey" }}>(необязательный)</span>:
              </td>
              <td>
                <TextField
                  id="outlined-basic"
                  label=""
                  placeholder="Введите"
                  {...getFieldState({ fieldState, formState })}
                  variant="outlined"
                  {...field}
                />
              </td>
            </tr>
          )}
        />
      </FormControl>
      <Button type="submit" variant="contained">
        Submit
      </Button>
    </Form>
  );
};
